(71, 'Hi there! I was checking out the virtual tours and loved some of the floorplans offered but wanted to ask if prices have been set? I\'m looking for a 4x4 floorplan without shared bathrooms and am flexible on the floorplan and floor level but wanted to get some estimates for different rooms if available.', 'Asim', 'Sheikh', 'asim.sheikh@utexas.edu', '9726559475', 1588003505234, '1401', 'UNIT TH - D2.1', '2020-08-31 19:08:32', '1582801634'),
